import React, {useEffect, useState} from 'react';
import './section2.css';

export  function UEvents() {


  let newDate = new Date()
let dt = newDate.getDate();
let mnth = newDate.getMonth() + 1;
let yr = newDate.getFullYear();

  const [events, setEvents] = useState([{

    name: '',
    date: '',
    month: '',
    year: '',
    day: '',
    time: '',
    venue: ''
  }])

  useEffect(() => {
    fetch('http://localhost:8080/events')
    .then(res => {
      if(res.ok) {
        return res.json()
      }
    }).then((jsonRes) => {
      setEvents(jsonRes)})
  })

  function sortByProperty(property){  
   return function(a,b){  
      if(a[property] > b[property])  
         return 1;  
      else if(a[property] < b[property])  
         return -1;  

      return 0;  
   }  

  }
  events.sort(sortByProperty("year"));




  return (
    <div className="container">


          <div className="col-4 ">
            <div className='col col-s-6'>
               <h1>Events</h1>
               <div className="event">
                  <ul class="eventsUl">


                 {events.map(event => (






                    <li className="inline list">
                        <div className="time col-l-2">
                          <h3> {event.date} <br/><span>{event.month} </span><br/><span>{event.year} </span></h3>
                        </div>
                        <div className="details">
                          <div className="name col-l-7">
                            <h3>{event.name}</h3>
                            <i className="fas fa-clock"> {event.time} Hrs</i>
                          </div>
                          <div className="join col-l-3">
                            <a href="#">Join</a>
                          </div>
                        </div>
                    </li>



                    ))}

                       </ul>
                    </div>
            </div>
            </div>













        </div>

  );
}


